script: |
  super -f text -I q9468.spq | sort > q9468.out

inputs:
  - name: q9468.spq
    data: |
      SELECT DISTINCT - ( - ( + MIN ( col0 ) ) ) AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - 91 IN ( col0 - 66, + 21 + - + col0 + - col0, col1 );
  - name: tab1

outputs:
  - name: q9468.out
    data: |
      51
